INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 1, 102601, "リン", 0.0, 10040, 1, 0, "あたしだって\nやるときはやるよ！", "2030/12/17 14:59:59", 24001);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 1, 102601, "リン", 0.0, 10040, 1, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2030/12/17 14:59:59", 24002);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 1, 102601, "リン", 0.0, 10040, 1, 2, "終わった終わった\n一人でもなんとか\nなるもんだね", "2030/12/17 14:59:59", 24003);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 2, 102601, "リン", 0.0, 10040, 2, 3, "やったね！\nこれでようやく\nサボれるよ…", "2030/12/17 14:59:59", 24004);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 1, 102601, "リン", 0.0, 10040, 1, 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2030/12/17 14:59:59", 24005);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 2, 102601, "リン", 0.0, 10040, 2, 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2030/12/17 14:59:59", 24006);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 2, 102601, "リン", 0.0, 10040, 2, 6, "あたしも意外と\nやるもんでしょ？", "2030/12/17 14:59:59", 24007);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 4, 102601, "リン", 0.0, 10040, 4, 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2030/12/17 14:59:59", 24008);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 4, 102601, "リン", 0.0, 10040, 4, 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2030/12/17 14:59:59", 24009);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 4, 102601, "リン", 0.0, 10040, 4, 9, "まじめに\nやったんだけどな…\n悔しいな～", "2030/12/17 14:59:59", 24010);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 4, 102601, "リン", 0.0, 10040, 4, 10, "やられた…\nねずみって意外と\nてごわいね", "2030/12/17 14:59:59", 24011);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 0.0, 4, 102601, "リン", 0.0, 10040, 4, 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2030/12/17 14:59:59", 24012);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (0.0, "2020/04/30 12:00:00", 24, 1.81, 1, 102601, "リン", 0.0, 10040, 4, 12, "疲れた…\nけど、次こそは\n守り抜くよ…", "2030/12/17 14:59:59", 24013);
